import React from 'react';
import Receipt from './Receipt/Receipt';

const Receipts = props => {

        return this.props.receipts.map((receipt, index) => {
        return <Receipt
          location={receipt.location}
          item={receipt.item}
          date={receipt.date}
          price={receipt.price}
          key={receipt.id} />
        });
      };

export default Receipts;
